   "source": [
    "#Create an array of 10 random integers between 1 and 100\n",
    "array <- sample(1:100,10)\n",
    "print(array)\n",
    "#Calculate the mean\n",
    "media <- mean(array)\n",
    "print(\"La media es\")\n",
    "print(media)\n",
    "#Calculate the standard deviation\n",
    "desviacionEstandar <- sd(array)\n",
    "print(\"La desviacion estandares\")\n",
    "print(desviacionEstandar)"
   ]
