   "source": [
    "#Create a 2-dimensional array of 3 rows and 4 columns with random integer values. \n",
    "array2Dimesional <- matrix(sample(1:100,3*4),nrow=3,ncol=4)\n",
    "print(\"Array 2-dimensional\")\n",
    "print(array2Dimesional)\n",
    "#Then, calculate the sum of each row and column.\n",
    "suma_fila <- rowSums(array2Dimesional)\n",
    "print(\"La suma de cada fila es\")\n",
    "print(suma_fila)\n",
    "\n",
    "suma_columna <- colSums(array2Dimesional)\n",
    "print(\"La suma de cada columna es\")\n",
    "print(suma_columna)"
   ]
  },
