    "#Create a DataFrame with 3 columns: \"Name\", \"Age\", and \"City\". Add at least 5 rows of data to the\n",
    "#DataFrame.\n",
    "tabla<- data.frame(\n",
    "  Name = c(\"Pedro\", \"Ana\", \"Jacob\", \"Julissa\", \"Jesus\"),\n",
    "  Age = c(25, 32, 41, 28, 36),\n",
    "  City = c(\"Quito\", \"Seoul\", \"Lima\", \"Toronto\", \"Tokyo\")\n",
    ")\n",
    "print(tabla)\n",
    "\n",
    "#Then, filter the DataFrame to only include rows where the person's age is greater than\n",
    "#or equal to 30\n",
    "filtroDatos <- subset(tabla,Age>=30)\n",
    "print(\"Las personas que tienen mas o igual a 30 años son:\")\n",
    "print(filtroDatos)"
   ]
