    "#Create a scatter plot of random x and y values between 1 and 100 Generate random x and y values\n",
    "x <- runif(100, 1, 100)\n",
    "y <- runif(100, 1, 100)\n",
    "\n",
    "# Create a scatter plot\n",
    "plot(x, y, main = \"Scatter Plot\", xlab = \"X\", ylab = \"Y\", col=\"blue\")"
   ]
